import "./App.css";
import TitanClass from "./components/TitanClass";
import TitanFunc from "./components/TitanFunc";
import StateClass from "./components/StateClass";
import Count from "./components/Count";
import FunctionClick from "./components/FunctionClick";
import ClassClick from "./components/ClassClick";

function App() {
  return (
    <div className="App">
      <TitanFunc name="titan" titanName="joca" />
      <TitanFunc name="gypsy" titanName="jenny" />
      <TitanFunc name="sphinx" titanName="sphinx" />
      <TitanClass name="titan" titanName="joca" />
      <StateClass />
      <Count />
      <FunctionClick />
      <ClassClick />
    </div>
  );
}

export default App;
